    description: `<strong><span class="strong">Основные функции:</span></strong>\r\n\r\n<strong><span class="strong">Процессор Surround Sound </span></strong>\r\nОбработка низких и высоких частот для воспроизведения натуральных диаграмм направленности человеческого уха и обеспечения превосходной разборчивости речи и полноты восприятия.\r\n\r\n<strong> <span class="strong">17-полосная Warp Компрессия с расширенной полосой</span></strong>\r\nСверхбыстрая система Компрессии с высоким уровнем разрешения точно имитирует работу человеческого уха, что и обеспечивает максимально естественное качество звучания. Расширенная полоса позволяет внести в диапазон более высокие и более низкие частоты.\r\n\r\n<strong><span class="strong">Dual Stabilizer II и Whistle Control Менеджер подавления Обратной связи </span> </strong>\r\nСнижает шумы и звуковые помехи, возникающие из-за понижения/повышения тонов окружающих звуков.\r\n\r\n<strong><span class="strong">Environmental Optimizer Оптимизатор Окружения </span></strong>\r\nАвтоматически корректирует Усиление, обеспечивая баланс речи и шума. В результате –  комфорт, прекрасный звук и отличная Разборчивость речи в любой звуковой ситуации. Распознаёт 7 различных акустических ситуаций.\r\n\r\n<strong><span class="strong">Natural Directionality II Естественная Направленность </span></strong>\r\nМаксимально увеличивает отношение сигнал-шум в окружающем фоновом шуме, обеспечивая непревзойдённое сочетание максимально чёткой разборчивости речи и полного осознания звуковых ситуаций.\r\n\r\n<span class="strong"><strong> MultiScope Adaptive Directionality Адаптивная Направленность</strong> </span>\r\nОслабляет нежелательные фоновые шумы, регулируя фокус на 3 различные ширины диаграммы направленности. Тем самым улучшается качество Разборчивости речи в различных ситуациях Звукового Окружения.\r\n<span class="strong">\r\n<strong>Автоматическая программа SoftSwitching</strong> </span>\r\nАвтоматическое переключение из ненаправленного режима приёма в направленный.\r\n\r\n<span class="strong">NoiseTracker II Шумоподавление </span>\r\nАлгоритм многоуровневого снижения шума без потери Разборчивости речи.\r\n\r\n<strong><span class="strong">Технические характеристики модели:</span> </strong>\r\n<ul>\r\n \t<li>Процессор со встроенным шумоподавлением Surround Sound.</li>\r\n \t<li>Шумоподавление NoiseTracker II.</li>\r\n \t<li>17-канальный WARP звуковой процессор с расширенной полосой 7 кГц.</li>\r\n \t<li>9 регуляторов усиления в Aventa.</li>\r\n \t<li>Функция Whistle Control – максимальный уровень чувствительности.</li>\r\n \t<li>Подавление обратной связи Dual Stabilizer II.</li>\r\n \t<li>Импульсный фильтр шума и резких звуков Impulse Noise Smoother.</li>\r\n \t<li>Естественная направленность Natural Directionality.</li>\r\n \t<li>Автоматическая адаптивная направленность AutoScope Adaptive Directionality.</li>\r\n \t<li>Мультиадаптивная направленность MultiScope Adaptive Directionality.</li>\r\n \t<li>Адаптивная направленность Adaptive Directionality.</li>\r\n \t<li>Фиксированная направленность Fixed Directionality.</li>\r\n \t<li>Автоматическое переключение SoftSwitching.</li>\r\n \t<li>Подавление эха EchoStop.</li>\r\n \t<li>Оптимизатор Окружения Environmental Optimizer.</li>\r\n \t<li>Функция SmartSilencer.</li>\r\n \t<li>Функция регистрации информации Onboard Analyzer II.</li>\r\n \t<li>Задержка включения SmartStart.</li>\r\n \t<li>4 полностью настраиваемые программы.</li>\r\n \t<li>Акустические индикаторы.</li>\r\n</ul>`,




